'use strict'

const STATES = {
  A: {
    sameAsFirst: (seq, char) => { return {
      chars: seq.chars + char,
      state: STATES.AA,
      specials: seq.specials + 1,
    }},
    sameAsMiddle: (seq, char) => { return {} },
    different: (seq, char) => { return {
      chars: seq.chars + char,
      state: STATES.AB,
      diffIndex: 1
    }},
  },
  AA: {
    sameAsFirst: (seq, char) => { return {
      chars: seq.chars + char,
      specials: seq.specials + seq.chars.length - seq.diffIndex,
    }},
    sameAsMiddle: (seq, char) => { return {} },
    different: (seq, char) => { return {
      chars: seq.chars + char,
      state: STATES.AAB,
      diffIndex: seq.chars.length,
    }},
  },
  AB: {
    sameAsFirst: (seq, char) => { return {
      chars: seq.chars + char,
      state: STATES.ABA,
      specials: seq.specials + 1
    }},
    sameAsMiddle: (seq, char) => { return {
      chars: char.repeat(2),
      state: STATES.AA,
      diffIndex: 0,
      specials: seq.specials + 1
    }},
    different: (seq, char) => { return {
      chars: seq.chars.slice(-1) + char,
    }},
  },
  AAB: {
    sameAsFirst: (seq, char) => { return {
      chars: seq.chars + char,
      state: STATES.A_B_A,
      specials: seq.specials + 1,
    }},
    sameAsMiddle: (seq, char) => { return {
      chars: char.repeat(2),
      state: STATES.AA,
      diffIndex: 0,
      specials: seq.specials + 1,
    }},
    different: (seq, char) => { return {
      chars: seq.chars.slice(-1) + char,
      state: STATES.AB,
      diffIndex: 1,
    }},
  },
  ABA: {
    sameAsFirst: (seq, char) => { return {
      chars: char.repeat(2),
      state: STATES.AA,
      diffIndex: 0,
      specials: seq.specials + 1,
    }},
    sameAsMiddle: (seq, char) => { return {
      chars: seq.chars.slice(-2) + char,
      specials: seq.specials + 1,
    }},
    different: (seq, char) => { return {
      chars: seq.chars.slice(-1) + char,
      state: STATES.AB,
    }},
  },
  A_B_A: {
    sameAsFirst: (seq, char) => {
      const isMax = isMaxLengthDiffChars(seq.chars + char, seq.diffIndex)
      return {
        specials: seq.specials + seq.chars.length - seq.diffIndex,
        chars: (isMax ? seq.chars.slice(seq.diffIndex + 1) : seq.chars) + char,
        state: isMax ? STATES.AA : seq.state,
        diffIndex: isMax ? 0 : seq.diffIndex,
    }},
    sameAsMiddle: (seq, char) => { 
      const isShort = isOneSameCharAfterDiff(seq.chars, seq.diffIndex)
      const chars = (isShort ? seq.chars.slice(-2) : seq.chars.slice(seq.diffIndex + 1)) + char
      return {
        chars,
        state: isShort ? STATES.ABA : STATES.AAB,
        diffIndex: isShort ? 1 : chars.length - 1,
        specials: isShort ? seq.specials + 1 : seq.specials,
    }},
    different: (seq, char) => {
      const isShort = isOneSameCharAfterDiff(seq.chars, seq.diffIndex)
      const chars = (isShort ? seq.chars.slice(-1) : seq.chars.slice(seq.diffIndex + 1)) + char
      return {
        chars,
        state: isShort ? STATES.AB : STATES.AAB,
        diffIndex: isShort ? 1 : chars.length - 1,
    }},
  }
}

const COMPARISONS = [
  {
    name: 'sameAsFirst',
    predicate: (char, seq) => char === seq.chars[Math.max(0, seq.diffIndex - 1)]
  },
  {
    name: 'sameAsMiddle',
    predicate: (char, seq) => char === seq.chars[seq.diffIndex],
  },
  {
    name: 'different',
    predicate: (char, seq) => true,
  },
];

const isMaxLengthDiffChars = (chars, middleIndex) =>
  middleIndex - (chars.length - 1 - middleIndex) == 0
const isOneSameCharAfterDiff = (chars, diffIndex) =>
  chars.slice(diffIndex + 1).length == 1

const findStateModifier = (seq, char, comparisons) =>
  comparisons.reduce((comp, { name, predicate }) =>
      !comp && predicate(char, seq) ? name : comp, null)

const manageState = (seq, char) => {
  const stateModifier = findStateModifier(seq, char, COMPARISONS)
  return { ...seq, ...seq.state[stateModifier](seq, char) }
}

const substrCount = (n, s) => {
  if (!n) return 0
  const initialSeq = { chars: s[0], state: STATES.A, diffIndex: 0, specials: 0 }
  const specials = [...s.slice(1)]
    .reduce((seq, char) => manageState(seq, char), initialSeq)
    .specials
  return specials + n
}

console.log(substrCount(0, ''), 'should be 0')
console.log(substrCount(8, 'mnonopoo'), ' should be 12')
console.log(substrCount(5, 'asasd'), ' should be 7')
console.log(substrCount(7, 'abcbaba'), ' should be 10')
console.log(substrCount(4, 'aaaa'), ' should be 10')
console.log(substrCount(5, 'aabaa'), ' should be 9')
console.log(substrCount(55269, ''));
console.log(substrCount(65476, ''));
